import React from "react";
import Landing from "../../components/landing";
import Intro from "../../components/intro";
import Stastep from "../../components/stastep";
import Footer from "../../components/footer";
import "./style.scss";

const stepdata = {
  title: {
    left: `3 Step use for Fashion Seeker
    to book and consult`
  }
};

function DefaultFashionseeker() {
  return (
    <div className="home">
      <Landing></Landing>
      <Intro></Intro>
      <Stastep {...stepdata}></Stastep>
      <Footer></Footer>
    </div>
  );
}

export default DefaultFashionseeker;
